const ChatBox = (props) => {
    const {
        messages
    } = props;

    return (
        <ul>
            {messages.map((message) => (
            <li key={message.id}>
                <span>({message.sender})</span>
                <span>{message.text}</span>
            </li>
            ))}
        </ul>
    );
};

export default ChatBox;
